import React from "react";
import "./Education.css"

const Education = () => {
  return (
    <div className="Education">
      <div class="split left">
        <div class="centered">
          <h2>Jane Flex</h2>
          <p>Some text.</p>
        </div>
      </div>

      <div class="split right">
        <div class="centered">
          <h2>John Doe</h2>
          <p>Some text here too.</p>
        </div>
      </div>
    </div>
  );
};
export default Education;
